import React, { useState } from "react";
import StripeCheckout from "react-stripe-checkout";
import "../src/css/dep.css";
const stripeKey =
  "pk_test_51OR8kiSIm5G6fCOH1qQFbjSNZvv8qnS9ZEP6fMmJbeUCDKxN45UHHAEoajkpRjpNiO4Jn6s5Jl4FeUvbJEGr42QG00k4Oz2rEA";
const [amount, setamount] = useState();
function Depositform() {
  const twenty = async () => {
    setamount(20);
  };
  const fifty = () => {
    setamount(50);
  };
  const hundred = () => {
    setamount(100);
  };
  const fivehundred = () => {
    setamount(500);
  };
  const thousand = () => {
    setamount(1000);
  };
  const twothousand = () => {
    setamount(2000);
  };
  return (
    <div className="dmain">
      <div className="dbody">
        <div className="dh">DEPOSIT</div>
        <br />
        <button onClick={twenty}>20</button>

        <button className="db" onClick={fifty}>
          50
        </button>
        <button className="db" onClick={hundred}>
          100
        </button>
        <br />
        <button onClick={fivehundred} type="submit">
          500
        </button>
        <button className="db" onClick={thousand}>
          1000
        </button>
        <button className="db" onClick={twothousand}>
          2000
        </button>
      </div>
    </div>
  );
}
function Dep() {
  return (
    <StripeCheckout
      name="DEPOSIT AMOUNT"
      amount={amount}
      currency="INR"
      stripeKey={stripeKey}
    >
      <Depositform />
    </StripeCheckout>
  );
}
export default Dep;
